content [11]: == Family ==
Married, firstly, to noble councillor Magnus Karlsson (Eka) (d. between 1484 and 1487);
She married to Ture Pedersson Bielke and became the mother of Svante Turesson Bielke. After the death of her husband in 1577, she succeeded him as royal governor of Stranda hundred.
